import React, { useEffect, useState } from 'react';
import FetchEventsTurku from '../api/FetchEventsTurku';

export default function ListImages() {
  const [myEvents, setAllEvents] = useState<any>("")

  const allEvents = async (page: number) => {

    const res: any = await FetchEventsTurku(page);
    console.log(res.status);
    console.log(res.data);
    console.log(res.data.data);
    setAllEvents(res.data.data);
  }

  useEffect(() => {
    allEvents(1);
  }, [])

  return (
    // <h1>Events TURKU</h1>
    <>
      {myEvents &&
        myEvents.map((event: any, i: number) =>
          (<div key={i} className="col-lg-4 col-md-6">
            <div class="container">
              <div class="d-flex flex-column flex-md-row">
                <div class="col-sm">
                  <div class="card custom-card">
                    <div class="card-cover" style="background-image: url( https://picsum.photos/600/400/?random );">
                      <div class="circle-image" style="background-image: url( https://picsum.photos/200/110/?random );"></div>
                    </div>
                    <div class="card-body">
                      <h5 class="card-title">Card title</h5>
                      <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                    </div>
                  </div>
                </div>
                <div class="col-sm">
                  <div class="card custom-card">
                    <div class="card-cover" style="background-image: url( https://picsum.photos/605/405/?random );">
                      <div class="circle-image" style="background-image: url( https://picsum.photos/205/115/?random );"></div>
                    </div>
                    <div class="card-body">
                      <h5 class="card-title">Card title</h5>
                      <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                    </div>
                  </div>
                </div>
                <div class="col-sm">
                  <div class="card custom-card">
                    <div class="card-cover" style="background-image: url( https://picsum.photos/610/410/?random );">
                      <div class="circle-image" style="background-image: url( https://picsum.photos/210/120/?random );"></div>
                    </div>
                    <div class="card-body">
                      <h5 class="card-title">Card title</h5>
                      <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                    </div>
                  </div>
                </div>
              </div>
            </div>
            {/* <div className="card card-chart">
              <span className="card-header " style={{ height: '130px' }}>
                {event.images.length > 0 ? <img style={{ height: '90px' }} src={event.images[0].url} alt="event" /> : <img style={{ height: '90px' }} src='/images/logo.png' alt="no image" />}
                {event.id}
                {event.end_time}
                {event.name ? event.name.fi : 'no name'}
                {event.description ? event.description.fi : ''}
              </span>
            </div> */}
          </div>)
        )
      }
    </>
  )
}


